import React from 'react';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';
import {Link} from 'react-router-dom'

export default function Welcome(props){

    return(

        <Grid container justify="center" direction="column" alignItems="center" justifyContent="center" spacing={5}>
            <Grid item xs={12}>
                <h1 style={{color: '#084177'}}>Hit Next to Get Started</h1>
            </Grid>
            {
            Array.from({length: 11}).map((x,i) => <Grid key={"padding"+(i+1)} item xs={4}></Grid>)
            }
            <Grid item >
            <Link
                to="/step1/name"
            >
                <Button variant="outlined" color="primary" size="large">
                        NEXT    
                </Button>
                </Link>  
            </Grid>

      </Grid>

    )

}
